#navet {
  position: fixed;
  width: 100vw;
  a {
    color: #2595be;
    font-size: bolder;
  }

  a:hover {
    color: #175d77;
  }

  .header {
    background-color: rgba(255, 255, 255, 0.897);
    position: absolute;
    width: 100%;
    z-index: 3;
    box-shadow: 0px 0px 1px 0px rgba(68, 68, 68, 0.897);
  }

  .header ul {
    margin: 0;
    padding: 0;
    list-style: none;
    overflow: hidden;
  }

  .header ul a {
    display: flex;
    margin-bottom: 15px;
    text-decoration: none;
    justify-content: center;
    text-align: center;
    font-weight: 600;
  }

  .header .menu {
    clear: both;
    max-height: 0;
    transition: max-height 0.2s ease-out;
  }

  .header .menu-icon {
    padding: 20px 20px;
    position: relative;
    float: left;
    cursor: pointer;
  }

  .header .menu-icon .nav-icon {
    background: #2595be;
    display: block;
    height: 5px;
    width: 30px;
    position: relative;
    border-radius: 10px;
    transition: background 0.2s ease-out;
  }

  .header .menu-icon .nav-icon:before {
    background: #2595be;
    content: "";
    display: block;
    height: 100%;
    width: 100%;
    border-radius: 10px;
    position: absolute;
    transition: all 0.2s ease-out;
    top: 10px;
  }

  .header .menu-icon .nav-icon:after {
    background: #2595be;
    content: "";
    display: block;
    height: 100%;
    width: 100%;
    border-radius: 10px;
    position: absolute;
    transition: all 0.2s ease-out;
    top: -10px;
  }

  .header .menu-btn {
    display: none;
  }

  .header .menu-btn:checked ~ .menu {
    max-height: 240px;
  }

  .header .menu-btn:checked ~ .menu-icon .nav-icon {
    background: transparent;
  }

  .header .menu-btn:checked ~ .menu-icon .nav-icon:before {
    transform: rotate(-45deg);
    top: 0;
  }

  .header .menu-btn:checked ~ .menu-icon .nav-icon:after {
    transform: rotate(45deg);
    top: 0;
  }

